import React from "react";
import NavBar from "./navbar";
const ProjectPricing = ({ navHidden, hideNav, switchNavState }) => {
  return (
    <div>
      <NavBar
        color="black"
        active="services"
        navHidden={navHidden}
        hideNav={hideNav}
        switchNavState={switchNavState}
      />
      <div>
        <div className="font-semibold bg-red-00 pt-32 text-center">
          Select Service Type
        </div>
        <div className="bg-red-500 my-5">
          <div className="uppercase font-semibold text-center">BASIC</div>
        </div>
      </div>
    </div>
  );
};

export default ProjectPricing;
